import React, { Component } from 'react';
import './App.css';
import News from './News/News'; 
import SaveNews from './News/SaveNews';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      news1: {
        type: 'top-headlines',
        query: 'sources=bbc-news'
      },
      news2: {
        type: 'everything',
        query: 'domains=techcrunch.com&language=en'
      },
      news3: {
        type: 'everything',
        query: 'domains=comicbookmovie.com&language=en'
      }
    };
  }

  render() {
    return (
      <div className="container-fluid">
          <ul class="tabs">
            <li class="tab col s3"><a href="#test1" class="active">Finance</a></li>
            <li class="tab col s3"><a href="#test2">Crypto</a></li>
            <li class="tab col s3 disabled"><a href="#test3">Regulation</a></li>
          </ul>
        <div className="row">
          <div className="col s8">
            <News news={this.state.news1} />
            <News news={this.state.news2} />
          </div>
          <div className="col s4">
            <h3>Save for Later</h3>
            <SaveNews news={this.state.news3} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;












